description:
Verenigde Staten
Drama
98 minuten

geregisseerd door Sacha Gervasi
met Anthony Hopkins, Helen Mirren en Scarlett Johansson

Hitchcock vertelt het liefdesverhaal van een van de meest invloedrijke filmmakers van de laatste eeuw, Alfred Hitchcock, en zijn vrouw en partner Alma Reville.
De film speelt zich af tijdens het maken van Hitchcock's beroemde griezelfilm Psycho in 1959.



